void wrap_send_gps_to_bs_output_fcn(double* input)
{
    gps_time_data.lat = input[0];
    gps_time_data.lon = input[1];
    gps_time_data.h = input[2];
    gps_time_data.vel = input[3];
    gps_time_data.course = input[4];
    gps_time_data.time = input[5]; 
    gps_time_data.pps = input[6];
    gps_time_data.gps_id = (int)input[7];
    pm_send_packet_c2k(PCK_GPS_TIME);      
}

